import React from "react"

class Software extends React.Component {

  render() {
    return (
      <div>
        <h3>Software</h3>
        <code>{this.state.software}</code>
        <h3>Version</h3>
        <code>{this.state.version}</code>
      </div>
    )
  }

}

export default Software
